function createReportDocumentLinks(n,t){var r=t.data.documents,i='<span><ul class="list-unstyled">';r.forEach(function(n){i+='<li class="doclink"><a href="#myModal" data-document-viewer data-doc-id="'+n.id+'" data-url="/document/'+n.id+'" data-toggle="modal" data-target="#myModal" data-title="'+n.filename+'" data-toggle="tooltip" title="'+n.filename+'" data-placement="right" data-original-title="'+n.filename+'">'+n.filename+"<\/a><\/li>"});i+="<\/ul><\/span>";n.append(i);$('li[class="doclink"] > a').each(function(){var n=$(this).data("doc-id");$("[data-doc-id="+n+"]").on("click",function(){var t=$(this),i=t.data("title"),r=t.data("url");$.ajax({url:r,type:"POST",success:function(t){window.showBSModal({title:i,body:t,size:"large",actions:[{label:"Cancel",cssClass:"btn-default",onClick:function(n){$(n.target).parents(".modal").modal("hide");$("body").removeClass("modal-open");$(".modal-backdrop").remove()}},{label:"Download",cssClass:"btn-primary",onClick:function(t){var i="/download/"+n;window.downloadFile(i);window.$log.info("Your file is being downloaded");$(".modalContainer").html("");$(".modal").modal("hide");$(t.target).parents(".modal").modal("hide");$("body").removeClass("modal-open");$(".modal-backdrop").remove()}}]})},error:function(){window.$log.error("Error showing history")}})})})}(function(){console.log("reports ready")});